import React, { Component } from 'react';

export class InfoCard extends Component {
    state = {  }
    render() { 
        return ( <Card>
            <Card.Body>
                <Card.Text>
                    {this.props.text}
                </Card.Text>
            </Card.Body>
        </Card> );
    }
}
 
export class InfoCardGrid extends Component {
    state = { 
        text: "lol"
     }
    render() { 
        return ( <Container>
            <Row>
                <Col> <InfoCard text = {this.state.text} /></Col>
                <Col> <InfoCard text = {this.state.text} /></Col>
            </Row>
        </Container> );
    }
}
